import {
  View,
  Text,
  ScrollView,
  TouchableOpacity,
  Image,
  ToastAndroid,
  FlatList,
  StyleSheet,
} from "react-native";
import React, { useState, useEffect } from "react";
import MaterialCommunityIcons from "react-native-vector-icons/MaterialCommunityIcons";

// import { items } from '../data/Database';

let items = [
  {
    id: 1,
    category: "Mèo",
    name: "Mèo Munchkin",
    price: 198100,
    descriptionBook: "Up to 20 hours battery life ",
    img: require("../assets/meo.jpg"),
    // quantityBuy: 1,
  },
  {
    id: 2,
    category: "Chó",
    name: "Chó Corgi",
    price: 78000,
    descriptionBook: "Up to 20 hours battery life ",
    img: require("../assets/corgi.jpg"),
    // quantityBuy: 1,
  },
  {
    id: 3,
    category: "Chó",
    name: "Chó Husky",
    price: 110000,
    descriptionBook: "Up to 20 hours battery life ",
    img: require("../assets/husky.jpg"),
    // quantityBuy: 1,
  },
];

const Cart = ({ navigation }) => {
  const [total, setTotal] = useState(null);
  const [book, setBook] = useState(items);
  const feeShip = 5000;

  useEffect(() => {
    const unsubscribe = navigation.addListener("focus", () => {
      getDataFromDB();
    });
    return unsubscribe;
  }, [navigation]);

  const getDataFromDB = () => {
    let productData = [];
    items.forEach((data) => {
      productData.push(data);
    });
    setBook(productData);
    getTotal(productData);
  };

  const checkOut = () => {
    items = [];

    navigation.navigate("Home");
  };

  // const plusQuantity = (id, quantityBuy) => {
  //   items.forEach((data) => {
  //     if (data.id == id) {
  //       data.quantityBuy = quantityBuy + 1;
  //     }
  //     getDataFromDB();
  //   });
  // };

  // const minusQuantity = (id, quantityBuy) => {
  //   items.forEach((data) => {
  //     if (data.id == id && data.quantityBuy > 1) {
  //       data.quantityBuy = quantityBuy - 1;
  //     }
  //     getDataFromDB();
  //   });
  // };

  const getTotal = (productData) => {
    let total = 0;
    for (let index = 0; index < productData.length; index++) {
      let productPrice = 0;
      if (productData[index].isDiscount) {
        let percent = productData[index].percent / 100;
        productPrice =
          (productData[index].price - productData[index].price * percent) *
          productData[index].quantityBuy;
      } else {
        productPrice =
          productData[index].price * productData[index].quantityBuy;
      }
      total = total + productPrice;
    }
    setTotal(total);
  };

  const removeItemFromCart = (id) => {
    for (let index = 0; index < items.length; index++) {
      if (items[index].id == id) {
        items.splice(index, 1);
      }
      getDataFromDB();
    }
  };

  const renderProducts = (item, index) => (
    <View key={item.id} style={styles.itemBody}>
      <View style={styles.itemViewImage}>
        <Image source={item.img} style={styles.itemImage} />
      </View>
      <View style={styles.itemContent}>
        <View>
          <Text style={styles.itemName}>{item.name}</Text>
          <View style={styles.itemViewPrice}>
            <Text style={styles.itemPrice}>{item.price} &#8363; </Text>
          </View>
        </View>
        <View style={styles.itemContentTool}>
          {/* <View style={styles.itemQuantity}>
            <View style={styles.itemViewPlusMinus}>
              <TouchableOpacity
                onPress={() => minusQuantity(item.id, item.quantityBuy)}
              >
                <MaterialCommunityIcons
                  name="minus"
                  style={styles.itemPlusMinus}
                />
              </TouchableOpacity>
            </View>
            <Text style={styles.itemNumQuantity}>{item.quantityBuy}</Text>
            <View style={styles.itemViewPlusMinus}>
              <TouchableOpacity
                onPress={() => plusQuantity(item.id, item.quantityBuy)}
              >
                <MaterialCommunityIcons
                  name="plus"
                  style={styles.itemPlusMinus}
                />
              </TouchableOpacity>
            </View>
          </View> */}
          <TouchableOpacity
            onPress={() => removeItemFromCart(item.id)}
            style={styles.itemViewDelete}
          >
            <MaterialCommunityIcons
              name="delete-outline"
              style={styles.itemBtnDelete}
            />
          </TouchableOpacity>
        </View>
      </View>
    </View>
  );

  return (
    <View style={styles.container}>
      <ScrollView style={{ paddingTop: 15, paddingHorizontal: 16 }}>
        <View>{book ? book.map(renderProducts) : setBook(null)}</View>
        <View>
          <View style={styles.ViewTotalFee}>
            <View style={styles.infoViewTotal}>
              <Text style={styles.infoTextTotal}>Tổng cộng</Text>
              <Text style={styles.infoMoneyTotal}>&#8363; {total}</Text>
            </View>
            <View style={styles.infoViewShipFee}>
              <Text style={styles.infoTextShipFee}>Phí vận chuyển</Text>
              <Text style={styles.infoMoneyShipFee}>&#8363; {feeShip}</Text>
            </View>
          </View>
          <View style={styles.ViewPayment}>
            <View style={styles.infoViewPayment}>
              <Text style={styles.infoTextPayment}>Thành tiền</Text>
              <Text style={styles.infoMoneyPayment}>
                &#8363; {total != 0 ? total + feeShip : 0}
              </Text>
            </View>
          </View>
        </View>
      </ScrollView>
      <View style={styles.paymentViewBtn}>
        <TouchableOpacity onPress={() => checkOut()} style={styles.paymentBtn}>
          <Text style={styles.paymentBtnText}>Thanh toán</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
};

export default Cart;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    width: "100%",
    height: "100%",
    backgroundColor: "#f5f5f5",
  },
